import React from 'react';
import { BrowserRouter as Router, Switch, Route } from 'react-router-dom';
import Work from './components/work.js';
import Ideas from './components/ideas.js';
import Ventures from './components/ventures.js';
import './styles/App.css';

function App() {
  return (
    <Router>
    <section>
     <a href="/" className="homelink"><h1>John Lloyd</h1></a>
      <ul id="navigation-bar">
          <li><a href="/work" className="item">Work</a></li>
          <li><a href="/ideas" className="item">Ideas</a></li>
          <li><a href="/ventures" className="item">Ventures</a></li>
      </ul>
      </section>
      <section id="main-content">
      <Switch>
      <Route path="/" component={Home} />
      <Route path="/work" component={Work} />
      <Route path="/ideas" component={Ideas} />
      <Route path="/ventures" component={Ventures} />
      </Switch>
      </section>
    </Router>

  );
}

const Home = () => (
<div>
 <h2>Home Page switch</h2>
</div>
);

export default App;
